import React from 'react'; 
import Card from './Card'; 

const CardList = ({ cats }) => {
  const cardArray = cats.map((user, i) => {
    return (<Card key={id} id={cats[i].id} name={cats[i].name} email={cats[i].email}/>)
  })
  return (
    <div>
      {cardArray}
    </div>
  );
}

export default CardList;
